INSERT INTO `briefing_gen_inst` (`id`, `gen_inst`, `remarks`, `updated_on`) VALUES
(1, 'a. Discussion on military, political, social & economic matters contrary to the interest of the BAF/country is prohibited.\r\nb. Do not get allured by wine, wealth or unsocial activities.\r\nc. No classified information shall be discussed with foreigners/unauthorized persons.\r\nd. Be very careful about the spy and foreign intelligence agencies.\r\ne. At all the time remains aware of the relation between Bangladesh and visiting country.\r\nf. Maintain a high standard of discipline.\r\ng. Do not become a member of any social, cultural or any other club /organisations or association.\r\nh. Try to avoid invitation and taking/ giving gift from/ to foreigners. However, gifts received under unavoidable circumstances to be forwarded to this directorate upon arrival as per AFO 113-13 dated 12 March 1996 for necessary clearence.\r\nj. Do not make any agreement with the foreigners unless you are authorized to do so.\r\nk. Do not accept any cash as gift/ payment/ gesture under any circumstances.\r\nl. Take care of your valuable belonging specially passport, official documents, foreign currency etc. Do not exchange your foreign currency with illegal and unauthorized dealers.\r\nm. Do not make any reference/ note of classified matters on your personal diaries.\r\nn. Check your personal album. Do not carry any photographs containing picture or military installations/ equipments/ sites.\r\np. For india visit please collect contact number of defence Wing, Bangladesh High Commission, India and intimate about you immediately after arrival. you are also advised to contact imm to defence Wing if any unwanted situation occurs.\r\nq. Do not carry any letter/ document from the visiting country by hand for onward handed over to respective Embassy/ High Commission in Bangladesh. \r\nr. Special Instruction(If Any) : \r\n                                                                                        ', '', '2020-05-03 05:11:23');
